import React from 'react';
import PropTypes from 'prop-types';
import { faUnlockAlt } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { InputGroup, FormControl, Button } from 'react-bootstrap';

import DisplayErrors from './DisplayErrors';
import ButtonLoader from './ButtonLoader/ButtonLoader';
import { SUBMIT } from '../utils/constants';

const PasswordResetForm = props => {
  return (
    <div className="card-text text-left">
      Enter new password.
      <div className="mt-4">
        <form onSubmit={props.handleSubmit} autoComplete="off">
          <DisplayErrors errors={props.formErrors} />
          <InputGroup>
            <InputGroup.Prepend>
              <InputGroup.Text className="pl-0">
                <FontAwesomeIcon icon={faUnlockAlt} />
              </InputGroup.Text>
            </InputGroup.Prepend>
            <FormControl
              type="password"
              placeholder="New Password"
              id={props.passwordFieldOneId}
              value={props.passwordFieldOneValue}
              name={props.passwordFieldOneName}
              onChange={props.handleChange}
            />
          </InputGroup>
          <InputGroup>
            <InputGroup.Prepend>
              <InputGroup.Text className="pl-0">
                <FontAwesomeIcon icon={faUnlockAlt} />
              </InputGroup.Text>
            </InputGroup.Prepend>
            <FormControl
              type="password"
              placeholder="New Password Again"
              id={props.passwordFieldTwoId}
              value={props.passwordFieldTwoValue}
              name={props.passwordFieldTwoName}
              onChange={props.handleChange}
            />
          </InputGroup>
          <Button
            block
            type="submit"
            className="btn onboarding-btn"
            disabled={props.disabled}
          >
            {props.inProgress && <ButtonLoader />}
            {!props.inProgress && SUBMIT}
          </Button>
        </form>
      </div>
    </div>
  );
};

PasswordResetForm.propTypes = {
  disabled: PropTypes.bool,
  handleSubmit: PropTypes.func.isRequired,
  formErrors: PropTypes.object.isRequired,
  passwordFieldOneId: PropTypes.string.isRequired,
  passwordFieldOneValue: PropTypes.string.isRequired,
  passwordFieldOneName: PropTypes.string.isRequired,
  passwordFieldTwoId: PropTypes.string.isRequired,
  passwordFieldTwoValue: PropTypes.string.isRequired,
  passwordFieldTwoName: PropTypes.string.isRequired,
  handleChange: PropTypes.func.isRequired,
  inProgress: PropTypes.bool.isRequired
};

PasswordResetForm.defaultProps = {
  disabled: true
};

export default PasswordResetForm;
